(113,"widget_custom_html","a:2:{i:2;a:2:{s:5:\"title\";s:24:\"与太郎の自己紹介\";s:7:\"content\";s:739:\"<div id=\"aboutMe\" style=\"\">\r\n<div class=\"myImg\"><a href=\"/?page_id=49\"><img src=\"https://yotarandum.net/wp-content/uploads/2018/09/cf03aa2e104383819b0a1c63af6f4676.png\" alt=\"与太郎\"></a></div>\r\n<div class=\"txt\">\r\n<p>\r\n	与太郎です<br>\r\n	僕の名前は与太郎です<br>\r\n	お仕事はコーダーです<br>\r\n	フロントエンドの範囲が広過ぎてとても出来る気がしません<br>\r\n	最近忘れっぽいので備忘録をつけるようにしました<br>\r\n	このサイトは個人的なメモです<br>\r\n	参考にしてくれた方への責任は負いませんので悪しからず<br>\r\n	間違いなどは優しく教えて頂ければ幸いです<br>\r\n	僕の名前は与太郎です<br>\r\n</p>\r\n</div>\r\n</div>\";}s:12:\"_multiwidget\";i:1;}","yes"),
